import desktop from "../../../../layout/assets/desktop.svg";
import mobile from "../../../../layout/assets/desktop.svg";

export const getDeviceIcon = (type) => {
  switch (type) {
    case "M":
      return mobile;
    case "D":
      return desktop;
    default: return null;
  }
};
